O Conselho Regional de Psicologia da 6ª Região (CRP06), por meio de suas unidades responsáveis pelos processos de compras, contratações e licitações, vem atuando para garantir maior eficiência, conformidade e economicidade nas aquisições públicas, alinhando suas práticas à legislação vigente, em especial à Lei nº 14.133/2021 (Nova Lei de Licitações e Contratos Administrativos).

Considerando esse contexto, justifica-se a contratação do treinamento disponibilizado por meio do Fórum Nacional dos Agentes de Contratação, Pregoeiros, Comissão de Contratação e Equipes de Apoio – Edição 2025, que será realizado no período de 11 a 13 de junho de 2025, em Recife/PE, conforme informações disponíveis no site oficial do evento: https://forum-nacional-agentes-contratacao.silp-forum.com.br/  

Objetivo da Capacitação
A participação de sete (07) profissionais do CRP06 diretamente envolvidos nos processos de compras públicas, licitações e contratações tem por finalidade o aprimoramento técnico e normativo quanto aos desafios operacionais e jurídicos da Nova Lei de Licitações, com ênfase nos seguintes pontos:

Atuação dos agentes de contratação, pregoeiros e comissões de contratação no novo regime;

Aplicação prática dos novos instrumentos previstos na Lei nº 14.133/2021, como o estudo técnico preliminar, o termo de referência, a pesquisa de preços, a gestão e fiscalização contratual, entre outros;

Abordagem de temas relevantes como contratações diretas, matriz de risco, gerenciamento de riscos, planejamento de contratações e os impactos do PNCP (Portal Nacional de Contratações Públicas);

Análise de casos práticos, debates com especialistas renomados e compartilhamento de boas práticas com órgãos públicos de todo o Brasil.

Relevância Institucional
A capacitação proporcionará atualização técnica qualificada, diretamente alinhada às necessidades atuais do CRP06, em especial no que se refere à transição e consolidação de processos com base na nova legislação, cuja vigência plena se consolidou em 2023.

A participação da diretoria representada pela Talita Fabiano de Carvalho (Conselheira Presidenta), Camila Andrade de Oliveira (Conselheira Vice-Presidenta), Ana Tereza da Silva Marques (Conselheira Secretária), Eduardo de Menezes Pedroso (Conselheiro Tesoureiro), da Comissão Especial das Relações Étnico Raciais (CRER) representada pela Conselheira Maria da Glória Calado, do Centro de Referências Técnicas de Psicologia e Políticas Públicas (CREPOP) representado pela Conselheira Mônica Cintrão França Ribeiro, da Comissão de Direitos Humanos (CDH) representada pelo Conselheiro Carlos Eduardo Mendes, da Comissão de Ética (COE) representada pela Conselheira Ione Aparecida Xavier e da Comissão de Orientação e Fiscalização (COF): Psicóloga Técnica Mayara Aparecida Bonora Freire no 23º Encontro Nacional da Associação Brasileira de Psicologia Social (ABRAPSO), a ser realizado entre os dias 04 a 07 de setembro de 2025, na Universidade Federal do Amazonas (UFAM), em Manaus/AM, justifica-se pela relevância acadêmica, científica e institucional do evento, que se configura como um dos mais importantes fóruns de debate sobre práticas, políticas e teorias da Psicologia Social no Brasil.

O evento contará com a presença de pesquisadores(as), docentes, estudantes e profissionais de diversas áreas do conhecimento, promovendo o intercâmbio de experiências, divulgação de pesquisas e atualização de práticas voltadas para a promoção de direitos sociais e políticas públicas.

A representação institucional tem por objetivo:

Atualizar conhecimentos e metodologias no campo da Psicologia Social, com reflexos diretos na atuação profissional e institucional;

Fortalecer a articulação entre pesquisa, ensino e práticas em políticas públicas;

Promover a visibilidade do órgão junto à comunidade científica;

Contribuir para a melhoria dos serviços públicos, por meio da formação continuada dos(as) servidores(as);

Garantir o alinhamento com as diretrizes de valorização e capacitação de pessoal.
